class Solution:
    def maximumHappinessSum(self, happiness: list[int], k: int) -> int:
        sum = 0
        happiness.sort(reverse=True)
        for i in range(k):
            if happiness[0] - i >= 0:
                sum += happiness[0] - i
                happiness.pop(0)
        return sum

    
